import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <div className="nav">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/addpresentation">Add Presentation</Link>
        </li>
        <li>
          <Link to="/viewpresentation">View Presentation</Link>
        </li>
      </ul>
    </div>
  );
};

export default Navigation;
